export function CompleteState() {
	return (
		<li className="w-full h-1/6 border-b-2 border-skin-circle flex items-center">
			<div className="w-1/12 h-full flex justify-end items-center border shrink-0">
				<div className="w-4/6 h-3/5 border rounded-full bg-gradient-to-br from-[#57DDFF] to-[#C058F3] flex justify-center items-center">
					<img src="../icon-check.svg" alt="check" width="50%" height="50%" />
				</div>
			</div>
			<span className="pl-8 font-['Josefin_Sans'] text-[25px] text-skin-color2 truncate line-throught">My normal Todo. It's amazing how it's cool xpppptttrr</span>
			<div className="w-1/12 h-full"></div>
		</li>
	)
}
